import React from 'react';
import './App.css';
import Person from './Person/Person'


function App() {
  return (
    <div className="App">
      <h1> Hi, I'm a React App</h1>
      <p> This is really working!</p>
      <Person name="Shiv" age="22"/>
      <Person name="Agrima" age="23"> My hobby is Racing</Person>
      <Person name="Suresh" age="27"/>
    </div>
  );
}

export default App;
